import React from "react";

import Google_MapApi_Loader from "./Google_Map_Api_Components/Google_MapApi_Loader";
import Google_MapApi_Action from "./Google_Map_Api_Components/Google_MapApi_Action"

export const Google_Map_Api_Integrator = () => {

    return <React.Fragment>

        <Google_MapApi_Loader></Google_MapApi_Loader>
        <Google_MapApi_Action></Google_MapApi_Action>

    </React.Fragment>

}

export default Google_Map_Api_Integrator;
